import React, { useState } from 'react';

const OrderTracking = () => {
  const [orderId, setOrderId] = useState('');
  const [orderStatus, setOrderStatus] = useState('');
  const [error, setError] = useState('');

  // Example order status simulation
  const orderStatuses = {
    '12345': 'Shipped',
    '67890': 'Delivered',
    '11223': 'In Progress',
    '44556': 'Canceled',
  };

  const handleTrackOrder = () => {
    if (orderStatuses[orderId]) {
      setOrderStatus(orderStatuses[orderId]);
      setError('');
    } else {
      setError('Invalid Order ID. Please check and try again.');
      setOrderStatus('');
    }
  };

  return (
    <div className="p-6">
      <h2 className="text-3xl font-bold mb-4">Order Tracking</h2>

      <div className="flex flex-col gap-4">
        <label htmlFor="orderId" className="text-lg font-semibold">Enter Order ID</label>
        <input
          type="text"
          id="orderId"
          value={orderId}
          onChange={(e) => setOrderId(e.target.value)}
          className="p-2 rounded-lg bg-gray-700 text-white"
          placeholder="Enter your order ID"
        />

        <button
          onClick={handleTrackOrder}
          className="mt-4 px-6 py-2 bg-teal-600 text-white rounded-full"
        >
          Track Order
        </button>

        {orderStatus && (
          <div className="mt-4 p-4 bg-gray-800 text-white rounded-lg">
            <p className="text-xl font-semibold">Order Status:</p>
            <p>{orderStatus}</p>
          </div>
        )}

        {error && <p className="text-red-500 mt-2">{error}</p>}
      </div>
    </div>
  );
};

export default OrderTracking;
